import "./landing.scss";

export default function Landing() {
  return (
    <div className="landing">
      <div>
        <h1>Digital Carpentry</h1>
        <h1>Bringing Ideas &gt; Reality</h1>
        <h2>Meet Tobias.</h2>
      </div>

      <div className={`text-fade-in p-wrapper`}>
        <p>Software Developer</p>
        <p>Technical Writer</p>
        <p>IT Generalist</p>
        <p>Security Enthusiast</p>
      </div>
      <span></span>
    </div>
  );
}
